def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def holder = groovyUtils.getXmlHolder(mockRequest.requestContent)
def reqRef = String.valueOf(holder.getNodeValue("//xcpt:RequestID"))
def responseId = reqRef + "_RESP"
context.setProperty("requestId", reqRef)
context.setProperty("responseId", responseId)

